/*Table structure for table `oms_ec_trade` */

DROP TABLE IF EXISTS `oms_ec_trade`;

CREATE TABLE `oms_ec_trade` (
  `ec_trade_id` varchar(32) NOT NULL,
  `ec_trade_code` varchar(100) NOT NULL,
  `prj_id` varchar(32) NOT NULL,
  `prj_name` varchar(50) NOT NULL,
  `shop_id` varchar(32) NOT NULL,
  `shop_name` varchar(50) NOT NULL,
  `shop_account` varchar(50) NOT NULL,
  `shop_type` varchar(50) NOT NULL,
  `ec_trade_status` varchar(20) NOT NULL COMMENT 'EB_WAIT_BUYER_PAY(等待买家付款) EB_WAIT_SELLER_SEND(等待卖家发货,即:买家已付款) EB_TRADE_PARTIALLY_SEND(交易部分发货) EB_TRADE_ALL_SEND(交易全部发货) EB_TRADE_FINISHED(交易成功) EB_TRADE_CANCELED(交易取消)',
  `ec_cust_code` varchar(100) DEFAULT NULL,
  `ec_cust_name` varchar(100) DEFAULT NULL,
  `trade_type` varchar(10) NOT NULL DEFAULT '一口价',
  `cons` varchar(50) DEFAULT NULL,
  `cons_tel` varchar(50) DEFAULT NULL,
  `cons_mobile` varchar(50) DEFAULT NULL,
  `cons_addr` varchar(100) DEFAULT NULL,
  `cons_post_code` varchar(10) DEFAULT NULL,
  `area_coding` varchar(10) DEFAULT NULL,
  `tot_weight` decimal(12,2) NOT NULL DEFAULT '0.00',
  `trade_money` decimal(12,2) NOT NULL DEFAULT '0.00',
  `paid_fee` decimal(12,2) NOT NULL DEFAULT '0.00',
  `lgst_fee` decimal(12,2) NOT NULL DEFAULT '0.00',
  `trade_disc` decimal(12,2) NOT NULL DEFAULT '0.00',
  `serv_fee` decimal(12,2) NOT NULL DEFAULT '0.00',
  `point_money` decimal(12,2) NOT NULL DEFAULT '0.00',
  `ticket_money` decimal(12,2) NOT NULL DEFAULT '0.00',
  `paid_time` datetime DEFAULT NULL,
  `end_time` datetime DEFAULT NULL,
  `cust_remark` varchar(200) DEFAULT NULL,
  `sales_remark` varchar(200) DEFAULT NULL,
  `remark` varchar(200) DEFAULT NULL,
  `invoice` char(1) DEFAULT 'n',
  `invoice_title` varchar(50) DEFAULT NULL,
  `alipay_order_no` varchar(50) DEFAULT NULL,
  `create_time` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3),
  `update_time` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3),
  `deleted` char(1) NOT NULL DEFAULT 'n',
  `order_time` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3),
  `split_status` char(1) NOT NULL DEFAULT 'n',
  `parent_trade_id` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`ec_trade_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

