/*Table structure for table `oms_top_trade` */

DROP TABLE IF EXISTS `oms_top_trade`;

CREATE TABLE `oms_top_trade` (
  `top_trade_id` varchar(32) NOT NULL,
  `tid` bigint(20) DEFAULT NULL,
  `seller_nick` varchar(200) DEFAULT NULL,
  `pic_path` varchar(200) DEFAULT NULL,
  `payment` varchar(50) DEFAULT NULL,
  `seller_rate` int(11) DEFAULT NULL,
  `post_fee` decimal(12,2) DEFAULT NULL,
  `receiver_name` varchar(50) DEFAULT NULL,
  `receiver_state` varchar(50) DEFAULT NULL,
  `receiver_address` varchar(200) DEFAULT NULL,
  `receiver_zip` varchar(50) DEFAULT NULL,
  `receiver_mobile` varchar(20) DEFAULT NULL,
  `receiver_phone` varchar(50) DEFAULT NULL,
  `consign_time` datetime DEFAULT NULL,
  `received_payment` decimal(12,2) DEFAULT NULL COMMENT '（由于子订单可以部分确认收货，这个金额会随着子订单的确认收货而不断增加，交易成功后等于买家实付款减去退款金额）。精确到2位小数;单位:元。如:200.07，表示:200元7分',
  `est_con_time` datetime DEFAULT NULL COMMENT '格式:yyyy-MM-dd HH:mm:ss',
  `invoice_kind` varchar(1) DEFAULT NULL COMMENT '（ 1 电子发票 2 纸质发票 ）',
  `receiver_country` varchar(20) DEFAULT NULL,
  `receiver_town` varchar(50) DEFAULT NULL,
  `order_tax_fee` varchar(50) DEFAULT NULL,
  `paid_coupon_fee` decimal(12,2) DEFAULT NULL,
  `shop_pick` varchar(10) DEFAULT NULL,
  `num` int(11) DEFAULT NULL,
  `status` varchar(50) DEFAULT NULL,
  `title` varchar(50) DEFAULT NULL,
  `type` varchar(50) DEFAULT NULL,
  `price` decimal(12,2) DEFAULT NULL,
  `discount_fee` decimal(12,2) DEFAULT NULL,
  `has_post_fee` decimal(12,2) DEFAULT NULL,
  `total_fee` decimal(12,2) DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `pay_time` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  `end_time` datetime DEFAULT NULL,
  `buyer_message` varchar(255) DEFAULT NULL,
  `buyer_memo` varchar(255) DEFAULT NULL,
  `buyer_flag` int(11) DEFAULT NULL,
  `seller_memo` varchar(255) DEFAULT NULL,
  `seller_flag` int(11) DEFAULT NULL,
  `invoice_name` varchar(50) DEFAULT NULL,
  `invoice_type` varchar(20) DEFAULT NULL,
  `buyer_nick` varchar(50) DEFAULT NULL,
  `trade_attr` varchar(255) DEFAULT NULL,
  `credit_card_fee` decimal(12,2) DEFAULT NULL,
  `step_trade_status` varchar(50) DEFAULT NULL,
  `step_paid_fee` decimal(12,2) DEFAULT NULL,
  `mark_desc` varchar(100) DEFAULT NULL,
  `shipping_type` varchar(20) DEFAULT NULL,
  `buyer_cod_fee` decimal(12,2) DEFAULT NULL,
  `adjust_fee` decimal(12,2) DEFAULT NULL,
  `trade_from` varchar(50) DEFAULT NULL,
  `buyer_rate` int(11) DEFAULT NULL,
  `receiver_city` varchar(20) DEFAULT NULL,
  `receiver_district` varchar(20) DEFAULT NULL,
  `o2o` varchar(50) DEFAULT NULL,
  `o2o_guide_id` varchar(50) DEFAULT NULL,
  `o2o_shop_id` varchar(50) DEFAULT NULL,
  `o2o_guide_name` varchar(50) DEFAULT NULL,
  `o2o_shop_name` varchar(50) DEFAULT NULL,
  `o2o_delivery` varchar(20) DEFAULT NULL,
  `eticket_service_addr` varchar(100) DEFAULT NULL,
  `rx_audit_status` varchar(20) DEFAULT NULL,
  `es_range` varchar(50) DEFAULT NULL,
  `es_date` varchar(50) DEFAULT NULL,
  `os_date` varchar(50) DEFAULT NULL,
  `os_range` varchar(50) DEFAULT NULL,
  `coupon_fee` decimal(12,2) DEFAULT NULL,
  `o2o_et_order_id` varchar(50) DEFAULT NULL,
  `post_gate_declare` int(11) DEFAULT NULL,
  `cross_bonded_declare` int(11) DEFAULT NULL,
  `omnichannel_param` varchar(255) DEFAULT NULL,
  `assembly` varchar(50) DEFAULT NULL,
  `top_hold` int(11) DEFAULT NULL,
  `omni_attr` varchar(50) DEFAULT NULL,
  `omni_param` varchar(50) DEFAULT NULL,
  `forbid_consign` int(11) DEFAULT NULL,
  `identity` varchar(50) DEFAULT NULL,
  `team_buy_hold` int(11) DEFAULT NULL,
  `share_group_hold` int(11) DEFAULT NULL,
  `ofp_hold` int(11) DEFAULT NULL,
  `o2o_step_trade_detail` varchar(50) DEFAULT NULL,
  `o2o_step_order_id` varchar(50) DEFAULT NULL,
  `o2o_voucher_price` varchar(50) DEFAULT NULL,
  `is_sh_ship` int(11) DEFAULT NULL,
  `o2o_snatch_status` varchar(10) DEFAULT NULL,
  `market` varchar(50) DEFAULT NULL,
  `et_type` varchar(20) DEFAULT NULL,
  `et_shop_id` int(11) DEFAULT NULL,
  `obs` varchar(10) DEFAULT NULL,
  `create_time` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3),
  `update_time` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3),
  `deleted` char(1) NOT NULL DEFAULT 'n',
  PRIMARY KEY (`top_trade_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

