insert  into `wf_org_dictionary`(`DICT_CODE`,`DICT_NAME`,`DICT_TYPE`) values ('CODE1','部门','unittype'),('CODE2','按钮','element'),('CODE3','文本框','element'),('CODE4','下拉列表','element');

/*Table structure for table `wf_org_menu` */

